import React, { Component } from "react";
import { BrowserRouter as Router, Route, Link } from "react-router-dom";
import { Container } from "semantic-ui-react";

import "../css/Sidebar.css";

import Content from "./Content";

function App() {
  return (
    <Router>
      <Container>
        <div class="sidenav">
          <p>About</p>
          <p>Services</p>
          <p>Clients</p>
          <p>Contact</p>
        </div>
        <div class="main">
          <Content />
        </div>
      </Container>
    </Router>
  );
}

export default App;
